	IFNULL((select SUM(value) from ready_report_indicator where name="new Acceptors of Oral Contraceptives, combined"  and voided=0 and Date_of_Indicator>=@startDate and Date_of_Indicator <=@endDate), 0) as newAcceptorsOralContraceptivesCombined,
